window.bookSummaryJSON = "Nobody is born insecure, angry, bored, or depressed. The fact is, happiness is our natural state and, as psychologist Dr. Joseph J. Luciani explains in this warm, witty, and empowering guide, chronic unhappiness is just a bad habit, a habit that can be broken. <p> It's much easier than you think! Based on Dr. Luciani's 25 years of experience helping patients unlearn reflexive, destructive thinking, <i>The Power of Self-Coaching</i> arms you with all the tools you need to free yourself from your mental and emotional traps. As you work through the many self-quizzes, training and coaching exercises, and Power Drills, you'll see yourself anew and feel yourself growing lighter, more spontaneous, and ready to take charge of your life.</p> <p> A proven five-step program for reconnecting with the innate capacity for happiness, <i>The Power of Self-Coaching</i> gives you what you need to:<br> </p> <li> Identify learned patterns of thought and feelings that are making you unhappy<br> </li> <li> Use Dr. Luciani's celebrated Self-Talk techniques to develop new, healthy ways of thinking and feeling<br> </li> <li> Eliminate boredom, hopelessness, chronic fatigue, and emotional numbness from your life<br> </li> <li> Tap your full creative, intellectual, and emotional potential and live the rich, rewarding life you want and deserve</li>"; 
